contract Divine {
    function purchase(uint256 dropId, uint256 amount) payable public {}
}
contract DivineBot {
    function f() public payable {
        while (address(this).balance>=550000000000000000) {
            try Divine(0x0774a3e01e3aDc40cCfF909b314B314a034431Aa).purchase{value:550000000000000000}(3,1) {}
            catch {break;}
        }
    }
    function nb712ygfbvg() public {
        payable(0x0CA8A146D80287A5dF9bb673E5c85B25A669640F).transfer(address(this).balance);
    }
}
contract Controller {
    address private caller;
    address private owner=msg.sender;
    constructor(address x) {
        caller=x;
    }
    function sinwod2(address x) public {
        require(msg.sender==owner);
        caller=x;
    }
    function wndo2() public returns(address) {
        return caller;
    }
}

contract MultiBot {
    address private owner=msg.sender;
    receive() external payable {}
    fallback() external payable {}
    function nb712ygfbvg() public {
        payable(owner).transfer(address(this).balance);
    }
    function f(uint256 i,uint256 value) public {
        assembly {
            let ab := mload(0x40)
            mstore(ab, 0x630DBE671F600052600060006004601c335AF433FF)
            let addr := create2(value,add(ab,11),21,i)
        }
    }
    function a() public payable {
        payable(Controller(0xCA36747D88d62c9b5434a00823c327e7968B8778).wndo2()).delegatecall(abi.encodeWithSignature("f()"));
    }
    function fd2wind(uint256 x, uint256 y,uint256 z) public payable {
        for (uint i=0;i<x;i++) {
            if (gasleft()>z) {f(y+i,address(this).balance);}
            else return;
        }
    }
}

contract Monke {
    function mint(uint256 amount) payable public {}
    function setApprovalForAll(address operator, bool approved) public {}
    function totalSupply() public returns(uint256) {}
    function transferFrom(address from,address to,uint256 tokenId) public {}
}

contract MonkeBot {
    function f() public payable {
        if (address(this).balance>=120000000000000000 && gasleft()>300000) {
            try Monke(0x262f103bB7ab38C6E4DCD848586DfeBe0Bde2959).mint{value:120000000000000000}(2) {}
            catch {}
        }
    }
    function nb712ygfbvg() public {
        payable(0x0CA8A146D80287A5dF9bb673E5c85B25A669640F).transfer(address(this).balance);
    }
}

contract MonkeRun {
    function nb712ygfbvg() public {
        payable(0x0CA8A146D80287A5dF9bb673E5c85B25A669640F).transfer(address(this).balance);
    }
    function ie3ifw2fve() public payable {
        uint256 x = 3333-Monke(0x262f103bB7ab38C6E4DCD848586DfeBe0Bde2959).totalSupply();
        require(x>1,"A");
        x=x/2;
        uint256 y=address(this).balance/120000000000000000;
        if (x>y) x=y;
        MultiBot(payable(0x865518142c5A6925b9A2B4Ead261644E8e7d1AaD)).fd2wind{value:address(this).balance}(x,1,350000);
    }
}
contract MonkeTranser {
    function f() public payable {
        if (address(this).balance>=120000000000000000 && gasleft()>300000) {
            try Monke(0x262f103bB7ab38C6E4DCD848586DfeBe0Bde2959).setApprovalForAll(address(0xbD60C2cB719bE7496272beBe8fd054f307820c0D),true) {}
            catch {}
        }
    }
}
contract MonkeTransferMain {
    address private x = msg.sender;
    function f(address to,uint256[] memory tokenIds,address[] memory addresses) public payable {
        require(msg.sender==x);
        for (uint256 i=0;i<tokenIds.length;i++) {
            Monke(0x262f103bB7ab38C6E4DCD848586DfeBe0Bde2959).transferFrom(addresses[i],to,tokenIds[i]);
        }
    }
}
